import React from 'react';

function Left() {
  return (
    <div className="left-sidebar">
      <h3>Left Sidebar</h3>
      <ul>
        <li><a href='/dashboard/dashboard'>Dashboard </a></li>
        <li><a href='/Brand'>Brand</a></li>
        <li>Cart</li>
        <li>Category</li>
        <li>Items</li>
        <li>Staff</li>
      </ul>
    </div>
  );
}

export default Left;
